import React from "react"
import { Typography } from "@material-ui/core"
import Card  from "../../../components/card/card"
import { Grid } from "@material-ui/core"
import { Button } from "@material-ui/core"
import "../../game/liveplay/liveplay.css"

export default function LivePlay(props){
    const one = "Level 1: Perception";
    const two = "Level 2: Connection";
    const three = "Level 3: Reflection";

    return (
        <Grid container xs={12} sm={12} md={12} lg={12}>
            <Grid item xs={3} sm={2} md={2} lg={2}></Grid>
            <Grid item xs={6} sm={8} md={8} lg={8} className="gameStyling">
                <Typography variant="h5" className="numberStyling">Card 1/15</Typography>
                <Card title={one} question="Would you rather eat a poo flavored brownie or a brownie flavored poo? Discuss." brand="Strangers or Not" />
                <Button variant="outlined" className="prevButton">Previous</Button>
                <Button variant="outlined" className="nextButton">Next</Button>
            </Grid>
            <Grid item xs={3} sm={2} md={2} lg={2}></Grid>
        </Grid>
    )
}
